import * as checkbox from "@ibrains-design/checkbox"
import { useMachine, normalizeProps } from "@ibrains-design/react"

function Checkbox() {
  const [state, send] = useMachine(checkbox.machine({ id: "1" }))

  const api = checkbox.connect(state, send, normalizeProps)

  return (
    <label {...api.getRootProps()}>
      <span {...api.getLabelProps()}>
        Input is {api.checked ? "checked" : "unchecked"}
      </span>
      <div {...api.getControlProps()} />
      <input {...api.getHiddenInputProps()} />
    </label>
  )
}
